package solution.leetcode;

import java.util.Stack;

public class RemovingStarsFromAString {

    public static void main(String[] args) {
        RemovingStarsFromAString remover = new RemovingStarsFromAString();
        System.out.println(remover.removeStars("leet**cod*e")); // "lecoe"
        System.out.println(remover.removeStars("erase*****")); // ""
        System.out.println(remover.removeStars("abb*cdfg*****x*")); //
        System.out.println(remover.removeStars("")); //
    }

    public String removeStars(String s) {
        Stack<Character> stack = new Stack<>();
        for(int i = 0; i<s.length(); i++){
            if(s.charAt(i) == '*'){
                stack.pop();
            }
            else{
                stack.push(s.charAt(i));
            }
        }
        StringBuilder sb = new StringBuilder();
        while(!stack.isEmpty()){
            sb.append(stack.pop());
        }
        return sb.reverse().toString();
    }

}
